description:
Summary:
Mike Wolfe and Frank Fritz look for hidden memorabilia by digging through junk piles, abandoned barns and neglected garages. Whether tracking down a one-of-a-kind Ferris wheel or sizing up a vintage Harley-Davidson, they must be prepared to verify an object's history and judge its value. Sometimes they make a buck; and sometimes they walk away with little more than the history of an item.

